<script type="text/javascript">
    (function (diagram) { $("#shape-links > .panel-heading a").text("Data");

var $panel = $("#panel-links");
$panel.attr("id", "main-panel");
$panel.css("max-height", "85vh");

$.get("https://crossorigin.me/http://www.stuhleck.at/html/D/lifte.asp", function (data) {
    var $t1 = $("<table class='table table-striped'><thead><tr><th>Lift</th><th>Name</th><th>Status</th></tr></thead></table>")
    var $lifts = $t1.append("<tbody></tbody>");
    var doc = new DOMParser().parseFromString(data, "text/html");
    var rows = $(doc).find("table:nth(0) tr");
    for (var i = 0; i < rows.length; ++i) {
        var src  = $(rows[i]).find("td:nth(0) img").attr("src");
        var lift = $(rows[i]).find("td:nth(1)").text();
        var name = $(rows[i]).find("td:nth(2)").text();
        if (!lift || !name)
            continue;
        
        var ja = src && src.indexOf("ja") >= 0;
        if (ja) {
            d3.selectAll(".lift-"+lift).classed("lift-on", true);
            $lifts.append($("<tr class='on'><td>" + lift + "</td><td>"+name+"</td><td>ON</td></tr>"));
        }
        
        var nein = src && src.indexOf("nein") >= 0;
        if (nein) {
            d3.selectAll(".lift-" + lift).classed("lift-off", true);
            $lifts.append($("<tr class='off'><td>" + lift + "</td><td>"+name+"</td><td>OFF</td></tr>"));
        }
    }
    $t1.appendTo($panel);
});


$.get("https://crossorigin.me/http://www.stuhleck.at/html/D/schneebericht.asp", function (data) {
    var $t2 = $("<table class='table table-striped'><thead><tr><th>Piste</th><th>Name</th><th>Status</th></tr></thead></table>")
    var $piste = $t2.append("<tbody></tbody>");
    var doc = new DOMParser().parseFromString(data, "text/html");
    var rows = $(doc).find("table:nth(0) tr");
    for (var i = 0; i < rows.length; ++i) {
        var piste = $(rows[i]).find("td:nth(0)").text();
        var src   = $(rows[i]).find("td:nth(3) img").attr("src");
        var name  = $(rows[i]).find("td:nth(1)").text();
        if (!piste || !name || name.indexOf("Park") > 0)
            continue;
        
        var ja = src && src.indexOf("ja") >= 0;
        if (ja) {
            d3.selectAll(".piste-"+piste).classed("lift-on", true);
            $piste.append($("<tr class='on'><td>" + piste + "</td><td>"+name+"</td><td>ON</td></tr>"));
        }
        
        var nein = src && src.indexOf("nein") >= 0;
        if (nein) {
            d3.selectAll(".piste-"+piste).classed("lift-off", true);
            $piste.append($("<tr class='off'><td>" + piste + "</td><td>"+name+"</td><td>OFF</td></tr>"));
        }

        var len    = $(rows[i]).find("td:nth(2)").text();
        var schnee = $(rows[i]).find("td:nth(4)").text();
        var qual   = $(rows[i]).find("td:nth(5)").text();
        
        $(".circle.piste-"+piste).tooltip({
            container: "body",
            html: true,
            title: "" +
                "Piste " + piste + ": "+ name + "<br/>" +
                "Länge: " + len + "<br/>" +
                "Schneehöhe: " + schnee + "<br/>" +
                "Schneequalität: " + qual + "<br/>"
        });

    }
    $t2.appendTo($panel);
});
 })(window.svgpublish);
